import {
  mdiAccountCircle,
  mdiDesktopMac,
  mdiGithub,
  mdiLock,
  mdiMonitorClean,
  mdiSquareEditOutline,
  mdiTable,
  mdiViewList,
  mdiTelevisionGuide,
  mdiResponsive
} from '@mdi/js'

export default [
  'General',
  [
    {
      to: '/',
      icon: mdiDesktopMac,
      label: 'Dashboard'
    }
  ],
  // 'Examples',
  [
    {
      to: '/tables',
      label: "Pizza's",
      icon: mdiTable,
      updateMark: true
    },
    {
      to: '/forms',
      label: "Customer's",
      icon: mdiSquareEditOutline
    },
    {
      to: '/ui',
      label: "Order's",
      icon: mdiTelevisionGuide
    },
    {
      to: '/responsive',
      label: "Order's Details",
      icon: mdiResponsive
    },
    {
      to: '/profile',
      label: "User's",
      icon: mdiAccountCircle
    },
    {
      to: '/login',
      label: 'Login',
      icon: mdiLock
    },
    {
      label: 'Submenus',
      subLabel: 'Submenus Example',
      icon: mdiViewList,
      menu: [
        {
          label: 'Sub-item One'
        },
        {
          label: 'Sub-item Two'
        }
      ]
    }
  ],
  'About',
  [
    {
      href: 'https://tailwind-vue.justboil.me/',
      label: 'Premium version',
      icon: mdiMonitorClean
    },
    {
      href: 'https://github.com/justboil/admin-one-vue-tailwind',
      label: 'GitHub',
      icon: mdiGithub
    }
  ]
]
